def fft(output_list, num_phases):
    pattern = (0, 1, 0, -1)
    for phase in range(num_phases):
        print("Phase",phase)
        input_list = output_list
        output_list = ''
        for i in range(len(input_list)):
            current_pattern = [x for x in pattern for _ in range(i+1)]
            sum_of_phase = 0
            for j in range(len(input_list)):
                val = input_list[j]
                index = (j+1) % len(current_pattern)
                multiplier = current_pattern[index]
                sum_of_phase += int(val) * multiplier
            output_list += str(sum_of_phase)[len(str(sum_of_phase))-1]
    return output_list[0:8]

def FFT(output_list, num_phases):
    pattern = (0, 1, 0, -1)
    output_list = [x for x in output_list]
    for phase in range(num_phases):
        print("Phase",phase)
        input_list = output_list
        output_list = []
        for i in range(len(input_list)):
            current_pattern = [x for x in pattern for _ in range(i+1)]
            sum_of_phase = 0
            for j in range(len(input_list)):
                val = input_list[j]
                index = (j+1) % len(current_pattern)
                multiplier = current_pattern[index]
                sum_of_phase += int(val) * multiplier
            if sum_of_phase < 0:
                sum_of_phase = sum_of_phase * -1
            output_list.append(sum_of_phase%10)
    return "".join(map(str, output_list[0:8]))

input = ""
# input = "12345678"
result = FFT(input, 100)
print(result)

